// client/src/App.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import { useTranslation } from 'react-i18next';
import axios from 'axios';

import Login from './components/Login';
import Register from './components/Register';
import Properties from './components/Properties';
import Buy from './components/Buy';
import Rent from './components/Rent';
import About from './components/About';
import Contact from './components/Contact';
import HomePage from './components/HomePage';

import './i18n';

axios.defaults.baseURL = 'http://localhost:3000';

const App = () => {
  const [user, setUser] = useState(null);
  const { t, i18n } = useTranslation();
  const languages = [
    { code: 'en', name: 'English' },
    { code: 'fr', name: 'Fran√ßais' },
    { code: 'es', name: 'Espa√±ol' },
    { code: 'tr', name: 'T√ºrk√ße' }
  ];

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      try {
        const payload = JSON.parse(atob(token.split('.')[1]));
        setUser(payload);
        axios.defaults.headers.common['Authorization'] = `Bearer ${token}`;
      } catch (e) {
        localStorage.removeItem('token');
      }
    }
  }, []);

  const handleLogout = () => {
    setUser(null);
    localStorage.removeItem('token');
    delete axios.defaults.headers.common['Authorization'];
  };

  const changeLanguage = (lng) => {
    i18n.changeLanguage(lng);
  };

  return (
    <Router>
      <div className="min-h-screen flex flex-col">
        {/* Header */}
        <header className="bg-primary text-white shadow-lg">
          <div className="container mx-auto px-4">
            <div className="flex justify-between items-center py-4">
              <div className="flex items-center">
                <Link to="/" className="text-2xl font-bold text-secondary">üè° Hausgold</Link>
              </div>

              <div className="hidden md:flex space-x-6">
                <Link to="/properties" className="hover:text-secondary transition-colors">Properties</Link>
                <Link to="/buy" className="hover:text-secondary transition-colors">Buy</Link>
                <Link to="/rent" className="hover:text-secondary transition-colors">Rent</Link>
                <Link to="/about" className="hover:text-secondary transition-colors">About Us</Link>
                <Link to="/contact" className="hover:text-secondary transition-colors">Contact</Link>
              </div>

              <div className="flex items-center space-x-4">
                <select
                  onChange={(e) => changeLanguage(e.target.value)}
                  value={i18n.language}
                  className="bg-secondary text-white p-1 rounded text-sm"
                >
                  {languages.map((lang) => (
                    <option key={lang.code} value={lang.code}>
                      {lang.name}
                    </option>
                  ))}
                </select>

                {user ? (
                  <div className="flex items-center space-x-4">
                    <span className="text-sm">üëã {user.email}</span>
                    <button onClick={handleLogout} className="btn-secondary text-sm">
                      {t('logout')}
                    </button>
                  </div>
                ) : (
                  <div className="space-x-2">
                    <Link to="/login" className="hover:text-secondary transition-colors text-sm">
                      {t('login')}
                    </Link>
                    <Link to="/register" className="bg-secondary text-white px-4 py-2 rounded-lg hover:bg-opacity-90 transition-colors text-sm">
                      {t('register')}
                    </Link>
                  </div>
                )}
              </div>
            </div>
          </div>
        </header>

        {/* Mobile Menu */}
        <div className="md:hidden bg-primary py-2 px-4">
          <div className="flex flex-wrap justify-center gap-4">
            <Link to="/properties" className="text-white hover:text-secondary text-sm">Properties</Link>
            <Link to="/buy" className="text-white hover:text-secondary text-sm">Buy</Link>
            <Link to="/rent" className="text-white hover:text-secondary text-sm">Rent</Link>
            <Link to="/about" className="text-white hover:text-secondary text-sm">About</Link>
            <Link to="/contact" className="text-white hover:text-secondary text-sm">Contact</Link>
          </div>
